import React from 'react';
import { Link } from 'react-router-dom';

function Footer() {
  return (
    <footer className="bg-gray-800 text-white">
      <div className="container mx-auto px-4 py-6">
        <nav className="mb-4">
          <ul className="flex justify-center space-x-6">
            <li><Link to="/faq" className="hover:text-gray-300">FAQ</Link></li>
            <li><Link to="/terms" className="hover:text-gray-300">Terms of Service</Link></li>
            <li><Link to="/privacy" className="hover:text-gray-300">Privacy Policy</Link></li>
            <li><a href="mailto:support@directorymaker.com" className="hover:text-gray-300">Contact</a></li>
          </ul>
        </nav>
        <p className="text-center">&copy; {new Date().getFullYear()} Directory Maker. All rights reserved.</p>
      </div>
    </footer>
  );
}

export default Footer;
